mappages["beldskaecave"].ClearEmOut = function(mapref) {
  mapref.Enter = function(who,frommap,oldx,oldy,destx,desty) {
    if (DU.gameflags.getFlag("beldskaeorcs")) {
      let npcs = mapref.npcs.getAll();
      for (let i=0;i<npcs.length;i++) {
        mapref.deleteThing(npcs[i]);
        DU.DUTime.removeEntityFrom(npcs[i]);
      }
    }
  }
}

mappages["beldskaecave"].ClearOrcs = function(mapref) {
  mapref.Exit = function(who,tomap,oldx,oldy,destx,desty) {
    if (destx === 129) { DU.gameflags.setFlag("beldskaeorcs"); }
  }
}

